scriptlet.script:
try {
	var sl = JSON.parse(serverList);
	var runId = scriptletContext.get("run_id");
	var ncpu = 0;
	var memory = 0;
	var servers = 0;

	var srvs = Object.keys(sl);
	srvs.forEach(function(s) {
		ncpu += parseInt(sl[s].nCPU);
		memory += parseInt(sl[s].memory);
		servers += 1;
	});


	var sql = "insert into ENA_ACTIVE_LABS (REQUEST,SERVICE_NAME,USER_NAME,LAB_ID,SERVERS,MEMORY,NCPU,STATUS,START_DATE,END_DATE) VALUES ('" + requestId + "','" + serviceName + "','" + userName + "','" + labID + "'," + servers + "," + memory + "," + ncpu + ",'PENDING_APPROVAL','" + startDate + "','" + endDate + "')"; 
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

var pr = scriptletContext.get("RS_Previous_Response");

switch(pr) {
	case "more items":
		if(output.trim().length > 0) {
			var li = output;
			var i = parseInt(li);
			li = (i<10)? "000" + i: (i<100)? "00" + i: (i<1000)? "0" + i : i;
			scriptletContext.put("labInstance",li);
		}
		scriptletResponse = "more";
	break;

	case "no more items":
		var labInstance = scriptletContext.get("labInstance");
		if(labInstance != undefined) {
			scriptletResponse = "complete";
		}
		else {
			scriptletResponse = "failure";
			scriptletContext.put("FailureMessage","Lab Instance is empty");
		}
	break;

	case udefined:
		scriptletResponse = "failure";
		scriptletContext.put("FailureMessage","Datatabse Error:" + output);
	break;
}

try {

	var sql = "select INSTANCE from ENA_ACTIVE_LABS WHERE REQUEST = '" + requestId + "'"; 
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}
